import React from "react";
const Button = ({ id, onClick }) => {
  if (id < 10)
    return (
      <button
        type="button"
        className="btn btn-primary"
        onClick={() => onClick()}
      >
        Next
      </button>
    );
  else if (id == 10)
    return (
      <button type="button" className="btn btn-primary">
        Submit
      </button>
    );
};

export default Button;
